    width: 100%;
    box-sizing: border-box;
    height: auto;


}

@mixin buttonStyle {
        outline: none;
        border: 1px solid #615cfd;
        border-radius: 25px;
        width: auto;
        padding: 0.95rem 2.1rem;
        font-size: 1rem;
        color: white;
        background: #615cfd;

        &:hover {
            animation: buttonHover .2s forwards linear;

        }
}

//text     
@keyframes slideFadeIn1 {
    from {
        opacity: 0;
        transform: translateX(-2rem);
    }to {
        opacity: 1;
        tranmform: translateX(0rem);
    }
}

@keyframes slideFadeIn2 {
    from {
        opacity: 0;
        transform: translateX(-2rem);
    }to {
        opacity: 1;
        tranmform: translateX(0rem);
    }
}

@keyframes buttonHover {
    from{
        background-color: #615cfd;
        color: white;
    }to{
        background: none;
        color: #615cfd;

    }
}

@keyframes boxHover {
    from {
        border-color: #E8E8E8;
    }to{
        border-color: #615CFD;
    }
}

