.section1{
    .wrapper1 {
        background: rgb(0, 0, 0);
        color: white;
        position: relative;
        width: 100%;
        padding: 0;
        @media screen and (max-width: 425px){
            bottom: 40%;
            height: 100vh;
        }

        @media screen and (min-width: 426px) and (max-width: 768px){
            height: 100vh;
            padding: 0;
        }

        @media screen and (min-width: 426px) and (max-width: 1440px){
            height: 120vh;
            padding: 0;
        }

        .section1-background{
            opacity: 0.4;
            width: 100%;
            height: 100%;
        }

        .section1__contents-block{
            position: absolute;
            left: 5%;
